'''Jeu de données pour le cours sur les K plus proches voisins (exercice)
                  Jeux de données : listes ech_train, ech_test
                  donnée = couple (image,étiquette)
                  image : matrice 16x16 vectorisée, coefficients entiers de 0 à 255
                  étiquette : haut, bas, droite, gauche

                  Fonction affiche : affiche l'image représentée par un vecteur'''
import matplotlib.pyplot as plt
import numpy as np

def matrice_vecteur(v):
    '''Réordonne un vecteur de longueur 256 en matrice 16*16'''
    return np.array(v,dtype=np.uint8).reshape((16,16))

def affiche(v):
    '''Affiche l'image représentée par le vecteur v'''
    plt.clf()
    plt.imshow(matrice_vecteur(v),cmap="gray", interpolation='none')
    plt.show()
    return None

